import React from "react";
import { Navbar, Nav } from "react-bootstrap";
import { LinkContainer } from "react-router-bootstrap";
function NavigationBar() {
  return (
    <Navbar bg="dark" expand="lg" variant="dark">
      <Navbar.Brand href="#home">WORDLE</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <LinkContainer to="/">
            <Nav.Link>Home</Nav.Link>
          </LinkContainer>
          <LinkContainer to="/rules">
            <Nav.Link>Rules</Nav.Link>
          </LinkContainer>
          <LinkContainer to="/easy level">
            <Nav.Link>Easy Level</Nav.Link>
          </LinkContainer>
          <LinkContainer to="/difficult level">
            <Nav.Link>Difficult Level</Nav.Link>
          </LinkContainer>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
    // <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
    //   <Navbar.Brand href="#home">WORDLE</Navbar.Brand>
    //   <Navbar.Toggle aria-controls="responsive-navbar-nav" />
    //   <Navbar.Collapse id="responsive-navbar-nav">
    //     <Nav className="me-auto">
    //       <Nav.Link href="#features">Home</Nav.Link>
    //       <Nav.Link href="#about">About</Nav.Link>
    //       <Nav.Link href="#deets">Easy Level</Nav.Link>
    //       <Nav.Link eventKey={2} href="#memes">
    //         Difficult Level
    //       </Nav.Link>
    //     </Nav>
    //   </Navbar.Collapse>
    // </Navbar>
  );
}
export default NavigationBar;
